import React from "react";
import { useParams } from "react-router-dom";

const Game = (props) => {
  const { game } = props;
  console.log(game);
  const { id } = useParams();

  return (
    <div>
      <h3>{game.name}</h3>
      <h3>{`game.${id}`}</h3>
    </div>
  );
};

export default Game;
